// SPDX-License-Identifier: BUSL-1.1
pragma solidity >=0.7.6;

import "../interfaces/IUniswapV3PoolDeployer.sol";

import "./UniswapV3Pool.sol";

contract UniswapV3PoolDeployer is IUniswapV3PoolDeployer {
    struct Parameters {
        address factory;
        address token0;
        address token1;
        uint24 fee;
        int24 tickSpacing;
    }

    /// @inheritdoc IUniswapV3PoolDeployer
    Parameters public override parameters;

    /// @dev Deploys a pool with the given parameters by transiently setting the parameters storage slot and then
    /// clearing it after deploying the pool.
    /// @param factory The contract address of the Uniswap V3 factory
    /// @param token0 The first token of the pool by address sort order
    /// @param token1 The second token of the pool by address sort order
    /// @param fee The fee collected upon every swap in the pool, denominated in hundredths of a bip
    /// @param tickSpacing The spacing between usable ticks
    function deploy(
        address factory,
        address token0,
        address token1,
        uint24 fee,
        int24 tickSpacing
    ) internal returns (address pool) {
        // 初始化参数, 工厂合约、TOKEN 地址，手续费，手续费，tick space 大小
        parameters = Parameters({
            factory: factory,
            token0: token0,
            token1: token1,
            fee: fee,
            tickSpacing: tickSpacing
        });
        // 开始初始化 pool ，合约地址计算 使用sal,以便于 token 和 fee 不变的情况下，pool 不变，能从外部计算address
        pool = address(
            new UniswapV3Pool{
                salt: keccak256(abi.encode(token0, token1, fee))
            }()
        );
        // TODO 这里为嘛又要删除他呢
        // 由于需要 UniswapV3Pool  address 的地址可以只跟 salt 有关，而 initcode/creationCode  不变，这里就需要 UniswapV3Pool constructor 不能包含参数，所以这里的 param 需要先存储，然后让 UniswapV3Pool 可以取到
        //用完删除即可
        delete parameters;
    }
}

